package com.soecode.lyf.dto;import java.util.Date;public class ScheduleExecuteResult {		public ScheduleExecuteResult(String scheduleId,int status){		this.scheduleId=scheduleId;		this.status=status;	}	ScheduleExecuteResult(){			}    private int id;    private String scheduleId;    private Date startTime;    private Date endTime;    private int status;	public int getId() {		return id;	}	public void setId(int id) {		this.id = id;	}	public String getScheduleId() {		return scheduleId;	}	public void setScheduleId(String scheduleId) {		this.scheduleId = scheduleId;	}	public Date getStartTime() {		return startTime;	}	public void setStartTime(Date startTime) {		this.startTime = startTime;	}	public Date getEndTime() {		return endTime;	}	public void setEndTime(Date endTime) {		this.endTime = endTime;	}	public int getStatus() {		return status;	}	public void setStatus(int status) {		this.status = status;	}    }